import React, { Component } from "react";
import List from "@material-ui/core/List";
import { withStyles } from "@material-ui/core/styles";
import Avatar from "@material-ui/core/Avatar";

import PriorityHighIcon from "@material-ui/icons/PriorityHigh";
import WalkingIcon from "@material-ui/icons/DirectionsWalk";
import InfoIcon from "@material-ui/icons/Info";
import Command from "./Command";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Paper from "@material-ui/core/Paper";
import IconButton from "@material-ui/core/IconButton";

import ListItemSecondaryAction from "@material-ui/core/ListItemSecondaryAction";

const styles = theme => ({
  root: {
    flexGrow: 1,
    maxWidth: 752
  },
  demo: {
    backgroundColor: theme.palette.background.paper
  },
  title: {
    margin: `${theme.spacing.unit * 4}px 0 ${theme.spacing.unit * 2}px`
  }
});

class CommandList extends Component {
  state = {
    commands: [
      {
        command: "Shut the fuck up Sparky",
        action: "move",
        timestamp: 1234567
      },
      {
        command: "Sparky you're a peice of shit",
        action: "move",
        timestamp: 87654332
      },
      {
        command:
          "Even though I verbally abuse you, you're still my best friend Sparky, don't leave me",
        action: "priority",
        timestamp: 4134345
      }
    ]
  };

  getCommands() {
    return this.state.commands;
  }
  render() {
    const { classes } = this.props;
    return (
      <Paper className={classes.root}>
        <Table className={classes.table}>
          <TableHead>
            <TableRow>
              <TableCell>Type</TableCell>
              <TableCell align="right">Command</TableCell>
              <TableCell align="right">Timestamp</TableCell>
              <TableCell align="right">Info</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {this.state.commands.map(command => (
              <TableRow>
                <TableCell component="th" scope="row">
                  <Avatar>
                    {command.action === "move" ? (
                      <WalkingIcon />
                    ) : (
                      <PriorityHighIcon />
                    )}
                  </Avatar>
                </TableCell>
                <TableCell align="right">{command.command}</TableCell>
                <TableCell align="right">{command.timestamp}</TableCell>
                <TableCell align="right">
                  <ListItemSecondaryAction>
                    <IconButton aria-label="Info">
                      <InfoIcon />
                    </IconButton>
                  </ListItemSecondaryAction>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </Paper>
    );
  }
}
export default withStyles(styles)(CommandList);
